import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

const AdminDashboard = () => {
    const [providers, setProviders] = useState([]);
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(true);
    const navigate = useNavigate();

    const fetchProviders = useCallback(async () => {
        try {
            const token = localStorage.getItem('authToken');
            if (!token) return navigate('/login');

            const res = await fetch('http://localhost:5000/api/admin/providers', {
                headers: { 'Authorization': `Bearer ${token}` }
            });

            if (res.status === 403) throw new Error('Access Denied. You are not an administrator.');
            if (!res.ok) throw new Error('Failed to load provider data.');
            
            const data = await res.json();
            setProviders(data);
        } catch (err) {
            setError(err.message);
        } finally {
            setLoading(false);
        }
    }, [navigate]);

    useEffect(() => {
        fetchProviders();
    }, [fetchProviders]);

    const handleStatusChange = async (providerId, newStatus) => {
        try {
            const token = localStorage.getItem('authToken');
            const res = await fetch(`http://localhost:5000/api/admin/providers/${providerId}/status`, {
                method: 'PUT',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${token}`
                },
                body: JSON.stringify({ status: newStatus })
            });

            if (!res.ok) throw new Error('Failed to update status.');
            
            // Refresh the provider list to show the new status
            fetchProviders();
        } catch (err) {
            setError(err.message);
        }
    };
    
    const formatDate = (dateString) => new Date(dateString).toLocaleDateString();

    if (loading) return <div className="loading-message">Loading Admin Panel...</div>;

    return (
        <div className="admin-dashboard-container">
            <div className="admin-dashboard-card">
                <header className="admin-header">
                    <h1>Admin Panel</h1>
                    <p>Provider Moderation</p>
                </header>
                
                {error && <div className="error-message">{error}</div>}

                <table className="admin-table">
                    <thead>
                        <tr>
                            <th>Provider Name</th>
                            <th>Email</th>
                            <th>Location</th>
                            <th>Registered On</th>
                            <th>Status</th>
                            <th style={{ textAlign: 'center' }}>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {providers.map(provider => (
                            <tr key={provider.id}>
                                <td>{provider.name}</td>
                                <td>{provider.email}</td>
                                <td>{provider.location}</td>
                                <td>{formatDate(provider.created_at)}</td>
                                <td>
                                    <span className={`status-badge status-${provider.status.toLowerCase()}`}>
                                        {provider.status}
                                    </span>
                                </td>
                                <td className="action-buttons">
                                    {provider.status === 'Pending' && (
                                        <button className="btn-action btn-approve" onClick={() => handleStatusChange(provider.id, 'Approved')}>Approve</button>
                                    )}
                                    {provider.status === 'Approved' && (
                                        <button className="btn-action btn-suspend" onClick={() => handleStatusChange(provider.id, 'Suspended')}>Suspend</button>
                                    )}
                                     {provider.status === 'Suspended' && (
                                        <button className="btn-action btn-approve" onClick={() => handleStatusChange(provider.id, 'Approved')}>Re-Approve</button>
                                    )}
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default AdminDashboard;
